import { useState } from "react";
import DataService from "./services/tutorial.service";

const  App = () =>  {
  const temp: any = [];
  const [tableData, setTableData] = useState(temp);
  const [loading, setLoading] = useState(true);
  const [visible, setVisible] = useState(false);

  const getData = () => {
    setVisible(true);
    setLoading(true);
    DataService.getAll("http://algotraders.pythonanywhere.com/webDev/")
    .then(response => {
      console.log(response);
     setTableData(response.data);
     setLoading(false);
    })
    .catch(e => {
      console.log(e);
    });
}


  return (
    <div>
      <button className="bg-white text-red-400" onClick={() => getData()}>Load Data</button>
      <table className="table-auto">
  <thead>
    <tr>
      <th>Title</th>
      <th>Author</th>
      <th>Views</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <td>Intro to CSS</td>
      <td>Adam</td>
      <td>858</td>
    </tr>
    <tr className="bg-emerald-200">
      <td>A Long and Winding Tour of the History of UI Frameworks and Tools and the Impact on Design</td>
      <td>Adam</td>
      <td>112</td>
    </tr>
    <tr>
      <td>Intro to JavaScript</td>
      <td>Chris</td>
      <td>1,280</td>
    </tr>
  </tbody>
</table>
    </div>
  );
}

export default App;
